import React, {useState} from 'react';
import GetMyCabins from './GetMyCabins';
import {getAdmin} from "../../../Utils/Common";


export default function MyCabins(props){

    if (getAdmin() == false)
    {
    return(
        <div>
            <h3>My Cabins</h3>
            <GetMyCabins id={sessionStorage.getItem("user_id")}/>
        </div>
    )
    }

    else
    {
    return(
        <div>
            <h3>Cabins</h3>
            {props.location.state.user_id ? <GetMyCabins id={props.location.state.user_id}/> : <GetMyCabins id={sessionStorage.getItem("user_id")}/>}
        </div>
    )
    }
}
